Transformers Rescue Bots - Season 1 - Episodes 1 to 13 (WEB-DL - 480p)
----------------------------------------------------------------------

Meet the Transformers Rescue Bots! Chase, Heatwave, Blades, and Boulder
are given an important mission by Optimus Prime: Protect and learn about
mankind. Stationed on a technologically advanced island, they team up
with a family of first responders to protect their new home and along
the way, they learn what it really means to be a hero.

Produced by Atomic Cartoons and Hasbro Studios.

